    <p>{`Rancher 2.5.2 版本于 2020 年 11 月 11 日发布。单击`}<a parentName="p" {...{
        "href": "https://github.com/rancher/rancher/releases/tag/v2.5.2"
      }}>{`这里`}</a>{`查看英文版版本说明。`}</p>
    <h2 {...{
      "id": "重要说明"
    }}>{`重要说明`}</h2>
    <p>{`自 2.0 版本以来，Rancher 中的主要 UI 是 Cluster Manager。我们在 Rancher 2.4 中实验性地发布新的 UI Cluster Explorer 仪表板，已经升级到 GA 状态。有一些新的功能只在新的 Cluster Explorer 仪表板中可用。这些新功能中的一些功能与 Cluster Manager 中的现有功能类似，我们将尝试根据它们在 UI 中的位置来区分它们。。`}</p>
    <h3 {...{
      "id": "安装和升级说明"
    }}>{`安装和升级说明`}</h3>
    <ul>
      <li parentName="ul">{`由于最新的 cert-manager 版本的变化，Rancher 的安装或升级必须与 Helm 3.2.x+一起进行。`}</li>
      <li parentName="ul">{`在安装 Rancher 2.5 之前，Rancher HA 集群应该升级到 Kubernetes 1.17+。`}</li>
      <li parentName="ul">{`如果在空中加载的 Rancher 前使用代理，必须向 NO_PROXY 传递附加参数。`}</li>
      <li parentName="ul">{`不能再本地集群关闭，这意味着所有管理员都可以访问本地集群。如果你想限制本地集群的权限，必须使用一个新的角色：restricted-admin role。`}</li>
      <li parentName="ul">{`如果您正在使用 Rancher 管理其他 Rancher 实例，请不要在此时升级，因为围绕冲突的控制器存在已知问题。`}</li>
      <li parentName="ul">{`如果你正在运行 UI 的 forked 构建，并将 ui-index 设置为 local，你目前无法强制加载。`}</li>
    </ul>
    <h4 {...{
      "id": "docker-安装"
    }}>{`Docker 安装`}</h4>
    <ul>
      <li parentName="ul">{`启动 Rancher Docker 容器时，必须使用特权标志。更多信息请参见`}<a parentName="li" {...{
          "href": "/docs/rancher2/installation/other-installation-methods/single-node-docker/_index"
        }}>{`离线单节点安装指南`}</a>{`。`}</li>
      <li parentName="ul">{`如果你在安装 Docker 时使用了自定义证书，集群就不能被配置。`}</li>
      <li parentName="ul">{`当在离线环境中安装时，你必须向 Docker 运行命令提供一个自定义 registries.yaml 文件，如 k3s 文档中所示。如果注册表有证书，那么你也需要提供。`}</li>
      <li parentName="ul">{`围绕启动时间的 UI 问题。`}</li>
    </ul>
    <h3 {...{
      "id": "cluster-manager-和-cluster-explorer-中的重复功能"
    }}>{`Cluster Manager 和 Cluster Explorer 中的重复功能`}</h3>
    <ul>
      <li parentName="ul">{`由于潜在的 CRD 冲突，任何时候只能安装 1 个版本的功能。`}</li>
      <li parentName="ul">{`每个功能只能由它所部署的用户界面来管理。`}</li>
      <li parentName="ul">{`如果您在 Cluster Manager 中安装了该功能，则必须在 Cluster Manager 中卸载，然后再尝试在 Cluster Explorer 仪表盘中安装新版本。`}</li>
    </ul>
    <h3 {...{
      "id": "kubernetes-119"
    }}>{`Kubernetes 1.19`}</h3>
    <ul>
      <li parentName="ul">{`对于 K8s 1.19 和更新的版本，我们建议禁用 firewalld，因为已经发现它与各种 CNI 插件不兼容。`}</li>
      <li parentName="ul">{`由于 Kubernetes 1.19 中的某些指标发生了变化，Cluster Manager 中的某些警报在 K8s 1.19 中无法使用。`}</li>
    </ul>
    <h3 {...{
      "id": "已废弃的功能"
    }}>{`已废弃的功能`}</h3>
    <table>
      <thead parentName="table">
        <tr parentName="thead">
          <th parentName="tr" {...{
            "align": "left"
          }}>{`功能`}</th>
          <th parentName="tr" {...{
            "align": "left"
          }}>{`描述`}</th>
        </tr>
      </thead>
      <tbody parentName="table">
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}>{`Cluster Manager - Rancher 监控`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`Cluster Manager UI 中的监控已被新的监控图所取代，该监控图可在 Cluster Explorer 中的 Apps & Marketplace 中使用。`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}>{`Cluster Manager - Rancher 告警和通知`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`告警和通知功能现在直接与集群资源管理器中的应用程序和市场中可用的新监控图集成。`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}>{`Cluster Manager - Rancher 日志`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`使用集集群群资源管理器中的应用程序和市场中可用的新的日志，用新的日志解决方案替换功能。`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}>{`Cluster Manager - 多集群应用部署`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`现在建议使用 Cluster Explorer 中可用的由 Fleet 支持的 Rancher 持续交付处理部署到多个集群。`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}>{`Cluster Manager - Kubernetes CIS 1.4`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`扫描 Kubernetes CIS 1.5+基准扫描现在被一个新的扫描工具所取代，该工具部署在 Cluster Explorer 中的应用程序和市场中的 cis 基准图。`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}>{`luster Manager - Rancher 流水线`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`基于 Git 的部署管道现在推荐使用 Cluster Explorer 中可用的由 Fleet 支持的 Rancher 持续交付来处理。`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}>{`Cluster Manager - Istio v1.5`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`Istio 项目已经结束对 Istio 1.5 的支持，并建议所有用户升级。Istio 1.7 现在可以在 Cluster Explorer 的 Apps & Marketplace 中作为 Istio 图表使用。`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}></td>
          <td parentName="tr" {...{
            "align": "left"
          }}></td>
        </tr>
      </tbody>
    </table>
    <h2 {...{
      "id": "版本"
    }}>{`版本`}</h2>
    <p>{`下面的版本为当前的最新版和稳定版：`}</p>
    <table>
      <thead parentName="table">
        <tr parentName="thead">
          <th parentName="tr" {...{
            "align": "left"
          }}>{`类型`}</th>
          <th parentName="tr" {...{
            "align": "left"
          }}>{`Rancher 版本`}</th>
          <th parentName="tr" {...{
            "align": "left"
          }}>{`Docker 标签`}</th>
          <th parentName="tr" {...{
            "align": "left"
          }}>{`Helm 仓库`}</th>
          <th parentName="tr" {...{
            "align": "left"
          }}>{`Helm Chart 版本`}</th>
        </tr>
      </thead>
      <tbody parentName="table">
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}>{`最新版`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`v2.5.2`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`rancher/rancher:latest`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`server-charts/latest`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`v2.5.2`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}>{`稳定版`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`v2.5.2`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`rancher/rancher:stable`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`server-charts/stable`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`v2.5.2`}</td>
        </tr>
      </tbody>
    </table>
    <h2 {...{
      "id": "实验性功能"
    }}>{`实验性功能`}</h2>
    <ul>
      <li parentName="ul">
        <p parentName="li">{`OPA Gatekeeper。用户可以通过 Rancher 部署和管理更新的 GA 版 OPA Gatekeeper。在安装这个新功能之前，用户必须卸载第一个 Rancher 安装的 OPA Gatekeeper 版本。`}</p>
      </li>
      <li parentName="ul">
        <p parentName="li">{`RancherD：Rancher 的单一二进制安装。管理员创建 1 个或 3 个主机，并启动 RancherD 二进制来执行安装 Rancher 的所有工作。查看`}<a parentName="p" {...{
            "href": "https://rancher.com/blog/2020/rancherd-simplifies-rancher-deployment"
          }}>{`这篇博客文章`}</a>{`了解更多细节。`}</p>
      </li>
    </ul>
    <h2 {...{
      "id": "自-v251-以来修复的主要问题"
    }}>{`自 v2.5.1 以来修复的主要问题`}</h2>
    <ul>
      <li parentName="ul">{`本地集群将不再运行 cattle cluster-agent 和 node-agent。升级到 2.5.2 时，这些 pods 将被删除。`}</li>
      <li parentName="ul">{`如果您正在使用 Rancher 管理其他 Rancher 实例，您现在可以升级 Rancher，而不会面临提升的 CPU、负载或网络问题。`}</li>
      <li parentName="ul">{`Cluster Explorer 的监控功能现在可以安装在 K8s 1.16 集群上。`}</li>
      <li parentName="ul">{`Cluster Explorer 的监控功能现在可以安装在使用图表 9.4.201 及以上版本的加固集群中。`}</li>
      <li parentName="ul">{`Istio 现在可以在禁用 Ingress 网关的情况下安装。`}</li>
      <li parentName="ul">{`修正了一个 Longhorn 卸载被终止的 BUG。`}</li>
      <li parentName="ul">{`Rancher 现在支持在离线环境中部署 EKS 集群。`}</li>
      <li parentName="ul">{`修正了 2.5.1 中节点池的自动替换功能无法正常工作的 bug。`}</li>
      <li parentName="ul">{`你现在可以运行一个分叉的 UI，并将 ui-index 设置为 local 并强制加载。`}</li>
      <li parentName="ul">{`修正了一个 Launch kubectl 功能不能正常工作的错误。`}</li>
      <li parentName="ul">{`修正了一个 Windows 工作节点无法加入启用云提供商的集群的错误。`}</li>
      <li parentName="ul">{`修正了 Rancher Terraform 提供者的一个 bug，该 bug 导致节点 draining 无法被关闭。`}</li>
      <li parentName="ul">{`修正了在仪表盘中添加 http/ssh 凭证时，fleet 中的私有 Git repo 无法使用的问题。`}</li>
    </ul>
    <h2 {...{
      "id": "其他说明"
    }}>{`其他说明`}</h2>
    <h3 {...{
      "id": "cluster-explorer-功能注意事项和升级"
    }}>{`Cluster Explorer 功能注意事项和升级`}</h3>
    <ul>
      <li parentName="ul">{`总体`}<ul parentName="li">
          <li parentName="ul">{`并非所有的新功能目前都可以安装在加固的集群上。`}</li>
          <li parentName="ul">{`新功能预计将使用 Helm3 CLI 而不是 Rancher CLI 进行部署。`}</li>
          <li parentName="ul">{`新的日志和监控功能还不能与 windows 集群一起使用。`}</li>
        </ul></li>
      <li parentName="ul">{`Rancher 备份`}<ul parentName="li">
          <li parentName="ul">{`当迁移到具有 Rancher 备份功能的集群时，服务器-url 不能更改到不同的位置，必须继续使用相同的 URL。`}</li>
          <li parentName="ul">{`Rancher 持续交付(Fleet)在备份期间不处理。`}</li>
        </ul></li>
      <li parentName="ul">{`监控`}<ul parentName="li">
          <li parentName="ul">{`监控栈目前无法安装在 K8s 1.16 集群上。`}</li>
          <li parentName="ul">{`当新的监控功能部署在 K3 上时，需要设置特定的内存和 CPU 限制。`}</li>
          <li parentName="ul">{`监控有时在安装时出错，因为它不能识别 CRD。`}</li>
          <li parentName="ul">{`新的监控图部署了一个标准的 Prometheus 安装，它不支持项目级隔离。`}</li>
        </ul></li>
      <li parentName="ul">{`Istio
当入口网关被禁用时，Istio 的安装失败。`}</li>
      <li parentName="ul">{`Longhorn`}<ul parentName="li">
          <li parentName="ul">{`Longhorn 看到一个问题，如果 daemonset 发生变化，卸载可能会陷入停滞。`}</li>
          <li parentName="ul">{`OPA Gatekeeper (Experimental)。`}</li>
          <li parentName="ul">{`在安装新的 OPA 功能之前，必须先卸载 OPA 的第一版。`}</li>
        </ul></li>
    </ul>
    <h3 {...{
      "id": "改进和优化"
    }}>{`改进和优化`}</h3>
    <ul>
      <li parentName="ul">{`管理员现在可以选择将 CentOS/RHEL 8 操作系统与 Docker CE 一起用于本地 Rancher HA 集群和由 Rancher 配置的集群。请注意，这只适用于 Docker CE 19.03.13 及以上版本。为了能够使用我们的 Docker 安装脚本安装 Docker CE 19.03.13，如果您使用的操作系统镜像中包含包 runc，则需要在使用安装脚本之前手动删除，因为容器包会与该包冲突。安装包 iptables 的要求在安装脚本中处理。`}</li>
      <li parentName="ul">{`Stats 现在会将没有以下四个污点的所有节点的资源汇总，而不是依赖 worker 节点角色标签。`}<ul parentName="li">
          <li parentName="ul">{`"node-role.kubernetes.io/controlplane"`}</li>
          <li parentName="ul">{`"node-role.kubernetes.io/control-plane"`}</li>
          <li parentName="ul">{`"node-role.kubernetes.io/etcd"`}</li>
          <li parentName="ul">{`"node-role.kubernetes.io/master"`}</li>
        </ul></li>
      <li parentName="ul">{`从 9.4.201 版本的 Rancher 监控图开始，k3s 集群将切换到使用一个 PushProx 导出器而不是三个 PushProx 导出器，因此 k3s 集群不再需要增加内存限制。`}</li>
      <li parentName="ul">{`Keycloak SAML 提供者现在接受一个自定义实体 ID 字段。`}</li>
      <li parentName="ul">{`日志现在包含了关于源的数据。`}</li>
      <li parentName="ul">{`现在可以在 Rancher Helm 图表中指定 UI 图片路径。`}</li>
      <li parentName="ul">{`当使用 Cluster Explorer 的监控功能时，Istio 安装程序会自动将 Istio 仪表盘添加到 Grafana 中。`}</li>
    </ul>
    <h2 {...{
      "id": "版本信息"
    }}>{`版本信息`}</h2>
    <h3 {...{
      "id": "镜像"
    }}>{`镜像`}</h3>
    <ul>
      <li parentName="ul">{`rancher/rancher:v2.5.2`}</li>
      <li parentName="ul">{`rancher/rancher-agent:v2.5.2`}</li>
    </ul>
    <h3 {...{
      "id": "工具"
    }}>{`工具`}</h3>
    <ul>
      <li parentName="ul">{`cli - `}<a parentName="li" {...{
          "href": "https://github.com/rancher/rancher/releases/tag/v2.4.9"
        }}>{`v2.4.9`}</a></li>
      <li parentName="ul">{`rke - `}<a parentName="li" {...{
          "href": "https://github.com/rancher/rke/releases/tag/v1.2.2"
        }}>{`v1.2.2`}</a></li>
    </ul>
    <h3 {...{
      "id": "kubernete-版本"
    }}>{`Kubernete 版本`}</h3>
    <ul>
      <li parentName="ul"><a parentName="li" {...{
          "href": "https://github.com/rancher/hyperkube/releases/tag/v1.19.3-rancher2"
        }}>{`1.19.3`}</a>{`(默认版本）`}</li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "https://github.com/rancher/hyperkube/releases/tag/1.18.10-rancher1"
        }}>{`1.18.10`}</a></li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "https://github.com/rancher/hyperkube/releases/tag/1.17.13-rancher1"
        }}>{`1.17.13`}</a></li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "https://github.com/rancher/hyperkube/releases/tag/v1.16.15-rancher1"
        }}>{`1.16.15`}</a></li>
    </ul>
